// Function 1 to read from AXI stream to array
void inputdatamover(axis_in_stream &in,
		MATRIX_IN_T out_strm[X]){
    #pragma HLS pipeline off
	for (int i = 0; i < X; i++){
		
		axis_in_t temp = in.read();
        out_strm[i] = temp.data;

    }
}

// Function 2 to perform Averaged autocorrelation - outer product and average
void AutoCorrelation(MATRIX_IN_T rec_sig[X],
		MATRIX_IN_T matrix1[N][N]) {

    //#pragma HLS array_partition variable=rec_sig type=block factor=4
    int subarr = X + 1 - N;

    // Initialize the result matrix with zeros
    for (int k = 0; k < N; k++) {
        for (int l = 0; l < N; l++) {
            matrix1[k][l] = MATRIX_IN_T(0.0, 0.0);
        }
    }

    //#pragma HLS array_partition variable=matrix1 type=block factor=4

    

    // Perform autocorrelation and accumulate the results 
    for (int i = 0; i < subarr; i++) {
        for (int k = 0; k < N; k++) {
            for (int l = 0; l < N; l++) {
                //#pragma HLS LOOP_FLATTEN
                //#pragma HLS UNROLL 
                MATRIX_IN_T dat1 = hls::x_conj(rec_sig[k + i]) * rec_sig[l + i];
                matrix1[k][l] += dat1;
            }
        }
    }

    // Average the accumulated results
    for (int m = 0; m < N; m++) {
        for (int n = 0; n < N; n++) {
            matrix1[m][n] /= subarr;
        }
    }
}

// Givens rotation calculation - this finds sin and cos
void givensrotation(MATRIX_IN_T a,
		MATRIX_IN_T b,
		MATRIX_IN_T *cos_theta,
		MATRIX_IN_T *sin_theta){

	MATRIX_IN_T temp = a*a + b*b;
	DATA_1 temp2 = temp.real()*temp.real() + temp.imag()*temp.imag();
	DATA_1 r = hls::sqrt(temp2);

	DATA_1 x = temp.real();
	DATA_1 cosx = hls::sqrt((r+x)) * 0.7071067811865475; //1/root2
	DATA_1 sinx = hls::sqrt((r-x)) * 0.7071067811865475;
	MATRIX_IN_T hypo = MATRIX_IN_T(cosx,sinx);
	*cos_theta = a/hypo;
	*sin_theta = -b/hypo;
}

void MalM(MATRIX_IN_T A[N],
		MATRIX_IN_T B[N],
		MATRIX_IN_T cos_theta,
		MATRIX_IN_T sin_theta,
		MATRIX_IN_T C[N],
		MATRIX_IN_T D[N]){

    

	for (int i = 0; i < N; ++i){
        //#pragma HLS UNROLL factor=100
        
		C[i] = A[i]*cos_theta + B[i]*(-sin_theta);
		D[i] = A[i]*sin_theta + B[i]*cos_theta; // Apply Givens rotation to 2 matrix rows (A, B) -> get rotated rows (C, D).
	}
}

//  Function 5 to perform QRF using Given's Rotation
void qr_givens(MATRIX_IN_T A[N][N], //avg autocorr mat
		MATRIX_OUT_T noiseSS[N][N-T]) {

	MATRIX_IN_T R[N][N];
	MATRIX_IN_T Q[N][N];

    for (int i = 0; i < N; ++i) {
        for (int j = 0; j < N; ++j) {
            //#pragma HLS LOOP_FLATTEN //Cannot flatten loop
        	R[i][j] = A[i][j]; // init R as A
        	Q[i][j] = (i == j) ? MATRIX_IN_T(1.0, 0.0) : MATRIX_IN_T(0.0, 0.0); //init Q as I
        }
    }
    for (int i = 0; i < N - 1; ++i) {
        for (int j = i + 1; j < N; ++j) {
            //#pragma HLS LOOP_FLATTEN 
            
            MATRIX_IN_T cos_theta = MATRIX_IN_T(0.0, 0.0);
            MATRIX_IN_T sin_theta = MATRIX_IN_T(0.0, 0.0);
            givensrotation(R[i][i], R[j][i],&cos_theta,&sin_theta);
            MATRIX_IN_T temp1i[N];
            MATRIX_IN_T temp1j[N];
            MATRIX_IN_T temp2i[N];
            MATRIX_IN_T temp2j[N];
            //#pragma HLS ARRAY_PARTITION variable= temp1i complete
            //#pragma HLS ARRAY_PARTITION variable= temp1j complete
            //#pragma HLS ARRAY_PARTITION variable= temp2i complete
            //#pragma HLS ARRAY_PARTITION variable= temp2j complete
            MalM(R[i],R[j],cos_theta,sin_theta,temp1i,temp1j);
            MalM(Q[i],Q[j],cos_theta,sin_theta,temp2i,temp2j);
            for (int k = 0; k < N; ++k){
                //#pragma HLS LOOP_FLATTEN 
            	R[i][k] = temp1i[k];
				Q[i][k] = temp2i[k];
            	R[j][k] = temp1j[k];
				Q[j][k] = temp2j[k];
            }
        }
    }
    for (int i = 0; i < N; ++i) {
    	for (int j = T; j < N; ++j) {
            //#pragma HLS LOOP_FLATTEN 
    		MATRIX_OUT_T temp = MATRIX_OUT_T(Q[j][i].real(),Q[j][i].imag());
    		noiseSS[i][j-T] = hls::x_conj(temp);
    	} //get noise subspace
    }
}

// Function 6 to perform matrix multiplication
void matmul2(MATRIX_OUT_T pseudo_sig[N],
		MATRIX_OUT_T noiseSS[N][N-T],
		DATA_2 *spec){

//#pragma HLS ARRAY_PARTITION variable= noiseSS complete dim=1
//#pragma HLS ARRAY_PARTITION variable= pseudo_sig complete

	*spec = 0.0;
	DATA_2 dat1 = 0.0;
	for (int i = 0; i < (N-T); ++i)
	{
		MATRIX_OUT_T dat2 = MATRIX_OUT_T(0.0,0.0);
		#pragma HLS PIPELINE off
		for (int j = 0; j < N; ++j)
		{
            //#pragma HLS LOOP_FLATTEN 
			dat2 += (pseudo_sig[j] * noiseSS[j][i]);
		}
		dat1 += (dat2.real()*dat2.real()) + (dat2.imag()*dat2.imag());
	}
	*spec = dat1;
}

